(14, 1, '2024-02-26 11:31:06', '2024-02-26 11:31:06', '<!-- wp:shortcode -->\n[services]\n<!-- /wp:shortcode -->\n\n<!-- wp:columns {\"className\":\"hot-deals\"} -->\n<div class=\"wp-block-columns hot-deals\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":247,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://moody_studio.test/wp-content/uploads/2024/03/e68427f769538c845f495cd393329a0e-2-2-1024x768.png\" alt=\"\" class=\"wp-image-247\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\">HOT DEALS THIS WEEK</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">SALE UP 50% </h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">MODERN FURNITURE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"style\":{\"border\":{\"radius\":\"0px\"}},\"className\":\"is-style-fill\"} -->\n<div class=\"wp-block-button is-style-fill\"><a class=\"wp-block-button__link wp-element-button\" style=\"border-radius:0px\">VIEW NOW</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"className\":\"two-products-column\"} -->\n<div class=\"wp-block-columns two-products-column\"><!-- wp:column {\"className\":\"col-item-1\"} -->\n<div class=\"wp-block-column col-item-1\"><!-- wp:image {\"id\":102,\"width\":\"283px\",\"height\":\"auto\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://moody_studio.test/wp-content/uploads/2024/02/182d0a8e38cfe0f18ce2670939b6c218-1024x1024.png\" alt=\"\" class=\"wp-image-102\" style=\"width:283px;height:auto\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:buttons {\"className\":\"view-deta