(45, 'woocommerce-WCstripe-May-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Stripe plugin', '<strong>Your store requires a security update for the WooCommerce Stripe plugin</strong>. Please update the WooCommerce Stripe plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2024-02-26 10:54:07', NULL, 0, 'plain', '', 0, 0, 'info'),
